import React, { Component } from 'react';

class Category extends Component {
	render(){
		return (
			<div>
				<div class="headerWrapper__categoriesWrapper">
				<div class="headerWrapper__categoriesWrapper__container">
				<div class="homepageFontCategoriesWidget">
				<div class="homepageFontCategoriesWidget__text"><h2>Browse Fonts </h2>
				<span>by category</span></div>
				<div class="homepageFontCategoriesWidget__category">
				<div class="homepageFontCategoriesWidget__category__first">
				<div class="homepageFontCategoriesWidget__category__card">
				<a href="/search/tag%3A%22sans+serif%22/fonts/?sort=sales">
				<img src="https://cdn.myfonts.net/s/images/categories/futura-next.png" class="homepageFontCategoriesWidget__category__cardImage homepageFontCategoriesWidget__category__cardImage--category1" alt="Set in Futura Next by Neufville" title="Set in Futura Next by Neufville" /></a></div><div class="homepageFontCategoriesWidget__category__card"><a href="/search/tag%3A%22slab+serif%22/fonts/?sort=sales">
				<img src="https://cdn.myfonts.net/s/images/categories/queulat-condensed.png" class="homepageFontCategoriesWidget__category__cardImage homepageFontCategoriesWidget__category__cardImage--category2" alt="Set in Queulat Condensed by Latinotype" title="Set in Queulat Condensed by Latinotype" /></a></div><div class="homepageFontCategoriesWidget__category__card"><a href="/search/tag%3Aserif/fonts/?sort=sales">
				<img src="https://cdn.myfonts.net/s/images/categories/baskerville-display-pt.png" class="homepageFontCategoriesWidget__category__cardImage homepageFontCategoriesWidget__category__cardImage--category3" alt="Set in Baskerville Display PT by ParaType" title="Set in Baskerville Display PT by ParaType" /></a></div></div><div class="homepageFontCategoriesWidget__category__second"><div class="homepageFontCategoriesWidget__category__card">
				<a href="/search/tag%3Adisplay/fonts/?sort=sales">
				<img src="https://cdn.myfonts.net/s/images/categories/display.png" class="homepageFontCategoriesWidget__category__cardImage homepageFontCategoriesWidget__category__cardImage--category4" alt="Set in Frontage Condensed by Juri Zaech" title="Set in Frontage Condensed by Juri Zaech" /></a></div><div class="homepageFontCategoriesWidget__category__card"><a href="/search/tag%3Ahandwritten/fonts/?sort=score">
				<img src="https://cdn.myfonts.net/s/images/categories/reliable.png" class="homepageFontCategoriesWidget__category__cardImage homepageFontCategoriesWidget__category__cardImage--category5" alt="Set in Reliable by PizzaDude.dk" title="Set in Reliable by PizzaDude.dk" /></a></div><div class="homepageFontCategoriesWidget__category__card"><a href="/search/tag%3Ascript/fonts/?sort=sales">
				<img src="https://cdn.myfonts.net/s/images/categories/kaleidos-rough.png" class="homepageFontCategoriesWidget__category__cardImage homepageFontCategoriesWidget__category__cardImage--category6" alt="Set in Kaleidos Rough by Mika Melvas" title="Set in Kaleidos Rough by Mika Melvas" /></a></div></div></div></div></div></div>
			</div>
		)
	}

}

export default Category;
